static const struct utyperecord* GetRecord(unichar_t ch) {
    int index = 0;
    if (ch < 0x110000) {
        index = index1[ch >> SHIFT];
        index = index2[(index << SHIFT) + (ch & ((1 << SHIFT) - 1))];
    }
    assert(index >= 0 && index < sizeof(utype_records)/sizeof(utype_records[0]));
    return &utype_records[index];
}

